import Header from "../compoments/layout/Header";
import Footer from "../compoments/layout/Footer";
import HomeSection from "../compoments/body/HomeSection";
import Thumbnail from "../compoments/body/Thumbnail";
import "../styles/Home.css";
import logements from "../datas/datas";


function Home() {
  return (
    <div className="Home">
      <Header />
      <HomeSection /> 

      {logements.map(({ profile, index}) => (
        <Thumbnail 
        key={`${profile.title}-${index}`}  
        cover={profile.cover}
        title={profile.title}
      />
    ))}

      <Footer />
    </div>
  );
}

export default Home;
